  <div className="modal">
    <div className="modal-content">
      <div className="modal-header text-center">Correo requerido</div>
      <div className="modal-body">
        El correo es requerido para iniciar sesion
      </div>
    </div>
  </div>;
};

export default MessageEmailRequired;
